function cleanPNGMoves(pgnString) {
  return pgnString
    .replace(/\d+\./g, "")        // rimuove "1.", "2.", ecc.
    .replace(/[!?+#=]+/g, "")     // rimuove simboli (!, ?, +, ecc.)
    .replace(/\s+/g, " ")         // rimuove spazi multipli
    .trim();                      // rimuove spazi iniziali/finali
}

export { cleanPNGMoves };
